import React from 'react';
import { Box, Card, Heading, Paragraph, Tag } from '@digdir/designsystemet-react';

export interface TimelineProps {
  items: React.ReactNode[];
  children?: React.ReactNode;
}

interface TimelineItemProps {
  children: React.ReactNode;
}

interface TimelineItem {
  date: string;
  title: string;
  description: string;
  type: 'feature' | 'bugfix' | 'improvement';
}

const TimelineItem: React.FC<TimelineItemProps> = ({ children }) => (
  <div style={{ marginBottom: '1rem' }}>
    {children}
  </div>
);

const Timeline: React.FC<TimelineProps> & { Item: typeof TimelineItem } = ({ items, children }) => {
  const getTagColor = (type: TimelineItem['type']) => {
    switch (type) {
      case 'feature':
        return 'success';
      case 'bugfix':
        return 'danger';
      case 'improvement':
        return 'first';
      default:
        return 'second';
    }
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column' }}>
      {items || children}
    </div>
  );
};

Timeline.Item = TimelineItem;

export default Timeline;
